  [],\n\t\"title\": \"Fisheries-Independent Biological and Environmental Trawl Data
  from the Alabama Department of Conservation and Natural Resources (1981-2007) as
  Part of the Comparative Assessment of Gulf Estuarine Systems (CAGES) Database (NODC
  Accession 0115183)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-09-26T23:42:57.491567\",\n\t\"name\": \"fisheries-independent-biological-and-environmental-trawl-data-from-the-alabama-department-of-co\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The CAGES program (Comparative Assessment
  of Gulf Estuarine Systems) is designed to examine the differences between estuarine
  ecosystems and investigate why some are more productive than others. The program
  focuses on estuarine areas important to commercial fisheries and includes data on
  commercial finfish and invertebrate species, as well as other species commonly captured
  in trawl sampling. This Alabama dataset is a subset of the CAGES Relational Database
  which is a compilation of fishery-independent data contributed by natural resource
  agencies of the Gulf States (Texas, Louisiana, Mississippi, Alabama, and Florida).
  This data set includes data from trawls collected by the Alabama Department of Conservation
  and Natural Resources (ADCNR) and Gulf Coast Research Laboratory (GCRL), as well
  as associated hydrographic data. Trawl data were used to calculate CPUE (catch per
  unit effort) at each station for the years 1981 through 2007.\",\n\t\"license_title\":
